import React from 'react'; 
import './App.css';
import Wrapper from './components/Wrapper'; 

function App() {
  return (
    <Wrapper>
      <div className="container"> 
        <div className="row"> 
          THIS IS ROW 1 - HEADER
        </div>
        <div className="row">

            <div className="col s9">R2 COL1</div>
            <div className="col s3">R2 COL 2</div>

        </div>
      </div>
    </Wrapper>
  );
}

export default App;
